import { WelcomePage, SpineLayout, TemplateChart,ConanContent } from './';

export default {
  path: '',
  childRoutes: [{ path: 'spine', component: TemplateChart, isIndex: true },
  { path: 'conan', component: ConanContent, isIndex: true }],
};
